import React from 'react';
import imageSrc from '../assets/user'; // Replace with the actual path to your image

export default function Content() {
    return (
        <div style={{ display: 'flex', alignItems: 'center' }}>
            <div style={{ flex: 1, textAlign: 'center' }}>
                <p className="heading-text">Great legal help starts with having the best advocates</p>
            </div>
            <div style={{ flex: 1, textAlign: 'center', fontSize: '1.2em', color: 'white' }}>
                <img src={imageSrc} alt="Legal Image" style={{ maxWidth: '100px', marginRight: '20px' }} />
                <p>Join us in our mission to democratize the law</p>
                <p>Exceptional legal guidance from first-rate advocates</p>
                <p>If you're searching for new ways to help others and expand your practice, we'd love to hear from you.</p>
            </div>
        </div>
    );
}
